        bottom: 'auto',
        marginRigth: '-50%',
        transform: 'traslate(-50%,-50%)'
    }
};
Modal.setAppElement('#root');

export const CalendarModal = () => {
    return (
        <Modal
            isOpen={true}
            style={customStyle}
            contentLabel="Example Modal"
        >
            <h1>Holas </h1>
